  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Long Island NWR
  Complex (including Target Rock NWR, Wertheim NWR, Amagansett NWR, Conscience Point
  NWR, Morton NWR, Oyster Bay NWR, Seatuck NWR, and Lido Beach WMA) outlines Refuge
  accomplishments during the 1980 calendar year. The report begins with an introduction
  to the Refuge and information about weather conditions, habitat conditions, land
  acquisition activities, and the system status. Construction and maintenance are
  also described. Habitat management is covered; grasslands and wetlands are discussed.
  The wildlife section of the report discusses endangered and threatened species,
  migratory birds, and mammals. Interpretation and recreation activities are outlined;
  topics include information and interpretation, recreation, and law enforcement.
  Items of interest are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
